import React from "react"
import data from "../Json/class.json"

function ClassNotes() {
    return (
        <div style={{ marginTop: "5%" }}>
            {
                data && data.map(item => (
                    <div key={item.id}>
                        <h1>{item.name}</h1>
                    </div>
                ))
            }
        </div>
    )
}

export default ClassNotes
